import React from "react";

function countrySelect(props){
    return(
    <div className = "container-margins">
        <h1 className = "introText">{props}</h1>
        <div className = "img-text-flexbox">
            <p className = "Text">
                I am a passionate software developer who thrives on turning problems into functional and creative solutions. In an age with constant technological evolution, I embrace 
                the everchanging software landscape. 
                </p>
        </div>
    </div>);
}


let visitedCountries = ["Canada","Ireland","Egypt","Czech Republic","Germany","France","Greece","Iceland","Italy","Japan","Lao People's Democratic Republic","Mexico","Norway","Poland","Thailand"];
function recieveCountry (props){
    let contains = visitedCountries.includes(props); 
    if (contains === true){
        console.log("true");
        countrySelect(props);
    }else{
        console.log("false");
    }
}

export default recieveCountry;
